package db;

import db.DAOs.OperacionEgresoDAOMySQL;
import db.DAOs.TipoComprobanteDAOMySQL;
import domain.entities.ProveedorDocComer.DocumentoComercial;
import domain.entities.ProveedorDocComer.TipoComprobante;
import domain.entities.operacionComercial.OperacionEgreso;
import org.junit.Test;

public class TestDocumentoDAO {

    @Test
    public void TestGuardarContenidoDocumentoComercial() {
        TipoComprobante tipoComprobante = new TipoComprobanteDAOMySQL().buscarTipoComprobantePorId(1);

        DocumentoComercial documentoComercial = new DocumentoComercial();
        documentoComercial.setNumeroDocumentoComercial(new Long("555"));
        documentoComercial.setTipoDocumentoComercial(tipoComprobante);
        documentoComercial.setActivo(true);
        documentoComercial.setTipoDeAdjunto("Digital");
        documentoComercial.setContent("data:image/png;base64,".getBytes());

        EntityManagerHelper.beginTransaction();
        EntityManagerHelper.getEntityManager().persist(documentoComercial);
        EntityManagerHelper.commit();
    }

    @Test
    public void TestGuardarNuevoDocumentoEnEgresoYaExistente() {
        TipoComprobante tipoComprobante = new TipoComprobanteDAOMySQL().buscarTipoComprobantePorId(1);

        DocumentoComercial documentoComercial = new DocumentoComercial();
        documentoComercial.setNumeroDocumentoComercial(new Long("11"));
        documentoComercial.setTipoDocumentoComercial(tipoComprobante);
        documentoComercial.setActivo(true);
        documentoComercial.setTipoDeAdjunto("Digital");
        documentoComercial.setContent("data:image/png;base64,".getBytes());

        OperacionEgreso egreso = new OperacionEgresoDAOMySQL().buscarOperacionEgresoPorId(8);
        egreso.setDocumentoComercial(documentoComercial);

        new OperacionEgresoDAOMySQL().modificarOperacionEgreso(egreso);
    }
}
